    state = {
        formList:[]
    }


    componentDidMount() {
        console.log(this.props)
    }
    componentWillReceiveProps(nextProps){
        console.log(nextProps)
        this.setState({
            ...this.state,
            formList:this.props.FormList
        })
    }

    render() {

        return (
            <React.Fragment>
                <h1>Form List</h1>
                <Modal></Modal>
            </React.Fragment>
        )
    }

}

export default FormList;
